	add("teratoma", "{\"term\":\"teratoma\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{confix|terato|oma|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A benign or malignant tumour, especially of the gonads, that arises from germ cells and consists of different types of tissue such as skin, hair, or muscle\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1972\u0027\u0027, Patrick O\u0027Brian, \u0027Post Captain\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"‘What is a \u0027\u0027teratoma\u0027\u0027?’ asked Jack, holding the object in his hand. ‘A kind of grenado?’ ‘It is an inward wen, a tumour: we find them, occasionally, in the abdominal cavity. Sometimes they contain long black hair, sometimes a set of teeth: this has both hair \u0027and\u0027 teeth.’\", \"priority\":3}]}, \"synonyms\":{}}");

