	add("termination", "{\"term\":\"termination\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin {{m|la|terminationem}} (accusative of {{m|la|terminatio}}).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The process of terminating or the state of being terminated\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The process of firing an employee; ending one\u0027s employment at a business for any reason\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An end in time; a conclusion\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An end in space; an edge or limit\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An outcome or result\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The last part of a word; a suffix\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"An induced abortion\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A word, a term\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1599\u0027\u0027, w:William William Shakespeare, \u0027w:Much Ado About Much Ado About Nothing\u0027, s:Much Ado About Nothing Act 2 Scene\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"She speaks poniards, and every word stabs: if her breath were as terrible as her \u0027\u0027terminations\u0027\u0027, there were no living near her; she would infect to the north star\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The ending up of a polypeptid chain\", \"priority\":11}]}, \"synonyms\":{}}");

	add("terminator", "{\"term\":\"terminator\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027terminator\u0027 from the verb \u0027terminare\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who finishes\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A DNA sequence which causes RNA transcription to cease and an mRNA transcript to break off\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An electrical device that absorbs reflection at the end of a transmission line\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The line between the day side and the night side of a planet\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An artificial intelligence machine, created to destroy humans (after the 1984 film\", \"priority\":5}]}, \"synonyms\":{}}");

