	add("terminologist", "{\"term\":\"terminologist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who studies and uses terminology, especially in professional translation project management\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Christiane Nord, \u0027Training for the New Millennium: Pedagogies for translation and interpreting\u0027, edited by Martha Tennent, Benjamins Translation Library, p. 218\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"T]ranslation practice during training should, at least in part, be organised in projects where each student has the chance to play various roles: that of client, of revisor, of \u0027\u0027terminologist\u0027\u0027, of documentation assistant, of free-lancer, of in-house translator working for a translation company, etc\", \"priority\":3}]}, \"synonyms\":{}}");

	add("terminology", "{\"term\":\"terminology\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin \u0027terminus\u0027 (a term) + \u0027-ology\u0027 () from \u0027-o-\u0027 () + \u0027\u0027 from Ancient greek (to 1453) \u0027-λογία\u0027 (-logy, branch of study, to speak)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The doctrine of terms; a theory of terms or appellations; a treatise on terms, a system of specialized terms\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The set of terms actually used in any business, art, science, or the like; nomenclature; technical terms; as, the terminology of chemistry\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"year\u003d1919\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/science-and-technology/21581981-what-pollution-some-opportunity-others-welcome-plastisphere Welcome to the passage\u003d[The researchers] noticed many of their pieces of [plastic marine] debris sported surface pits around two microns across.Closer examination showed that some of these pits did, indeed, contain bacteria, and that in several cases these bacteria were dividing and thus, by the perverse arithmetic of biological \u0027\u0027terminology\u0027\u0027, multiplying\", \"priority\":4}]}, \"synonyms\":{}}");

	add("terminotics", "{\"term\":\"terminotics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|terminology + otics? ; compare French \u0026quot;terminotique\u0026quot;|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"computer assisted terminograph\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"c. 2011 \u0026quot;[http://www.translationromani.net/en/translation/translationterminology/terminologystudies Terminology Studies],\u0026quot; Translation Romani (website) \u0027(accessed 20 September 2015\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Terminography is the methodology-based practice of collecting, describing, and processing specialized terms, while terminotics refers to the practice of terminography assisted by computer tools and technologies, such as those designed for term extraction and parallel corpora creation\", \"priority\":3}]}, \"synonyms\":{}}");

	add("termitarium", "{\"term\":\"termitarium\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|termite|arium|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A termite colony\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Frank N. Young, Jr. \u0026amp; Gene Kritsky, \u0027A Survey of Entomology\u0027, Writers Club Press (2002), ISBN 9780595221431, [http://books.google.com/books?id\u003d3TcIM6ZG2JsC\u0026amp;pg\u003dPA163 page 163\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"When an opening is made in a \u0027\u0027termitarium\u0027\u0027, soldiers crowd into the breach, and either stop the invaders or fill the breach with their termite dead\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, P. J. Gullan \u0026amp; P.S. Cranston, \u0027The Insects: An Outline of Entomology\u0027, Wiley-Blackwell (2010), ISBN 9781444330366, [http://books.google.com/books?id\u003dS7yGZasJ7nEC\u0026amp;pg\u003dPA332 page 332\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The females are winged, but shed all but the stumps of the anterior veins after mating, before entering the \u0027\u0027termitarium\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Paul Stenner, \u0026quot;Pattern\u0026quot;, in \u0027Inventive Methods: The Happening of the Social\u0027 (eds. Celia Lury \u0026amp; Nina Wakeford), Routledge (2012), ISBN 9780415574815, [http://books.google.com/books?id\u003dLcMLnuxftHsC\u0026amp;pg\u003dPA137 page 137\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Likewise, given time, the initially rather random clay-gathering activity of termites results in a colossal \u0027\u0027termitarium\u0027\u0027, thanks to simple innate inclinations such as the preference to deposit one\u0027s ball of clay on larger balls of clay\", \"priority\":7}]}, \"synonyms\":{}}");

	add("termitophagy", "{\"term\":\"termitophagy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Feeding on termites as the dominant item of diet\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The aardvark or \u0026quot;ant bear\u0026quot; actually is mainly termitophagous rather than ant-eating\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Pekár S, Coddington JA, Blackledge TA., \u0027Evolution of stenophagy in spiders. Evolution. 2012 Mar;66(3):776-806. doi: 10.1111/j.1558-5646.2011.01471.x. Epub 2011 Oct 31.\u0027, Wiley-Blackwell, pages 776-80\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Six categories of stenophagy were found: myrmecophagy, araneophagy, lepidopterophagy, \u0027\u0027termitophagy\u0027\u0027, dipterophagy, and crustaceophagy\", \"priority\":4}]}, \"synonyms\":{}}");

