	add("territory", "{\"term\":\"territory\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"Latin \u0027territorium\u0027, from \u0027terra\u0027 (the earth) and -torium (place of occurrence)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A large extent or tract of land; a region; a country; a district\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"One of three of Canada\u0027s federated entities, located in the country\u0027s Arctic, with fewer powers than a province and created by Act of Parliament rather than by the Constitution: Yukon, Northwest Territories, and Nunavut\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A geographic area under control of a single governing entity such as state or municipality; an area whose borders are determined by the scope of political power rather than solely by natural features such as rivers and ridges\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/finance-and-economics/21582498-america-has-changed-way-it-measures-gdp-boundary-problems Boundary passage\u003dEconomics is a messy discipline: too fluid to be a science, too rigorous to be an art. Perhaps it is fitting that economists’ most-used metric, gross domestic product (GDP), is a tangle too. GDP measures the total value of output in an economic \u0027\u0027territory\u0027\u0027. Its apparent simplicity explains why it is scrutinised down to tenths of a percentage point every month\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An area that an animal of a particular species consistently defends against its conspecifics\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The part of the playing field or board over which a player or team has control\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A geographic area that a person or organization is responsible for in the course of work\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A location or logical space which someone owns or controls\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A market segment or scope of professional practice over which an organization or type of practitioner has exclusive rights\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"An area of subject matter, knowledge, or experience\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"12 July 2012\u0027\u0027, Sam Adams, AV Club \u0027Ice Age: Continental Drift\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"The matter of whether the world needs a fourth Ice Age movie pales beside the question of why there were three before it, but Continental Drift feels less like an extension of a theatrical franchise than an episode of a middling TV cartoon, lolling around on \u0027\u0027territory\u0027\u0027 that’s already been settled\", \"priority\":12}]}, \"synonyms\":{}}");

	add("terroir", "{\"term\":\"terroir\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|fr|terroir|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The complete set of local conditions in which a particular wine or family of wines is produced, including soil type, weather conditions, topography and wine-making savoir-faire\", \"priority\":1}]}, \"synonyms\":{}}");

